import { Table } from "antd";

const columns = [  {    title: "Padrao",    dataIndex: "padrao",    key: "padrao",    width: 100,    fixed: "left",    title: " ",  },  {    title: "",    children: [        {           title: "Unidades",           dataIndex: "unidades",           key: "unidades",          children: [            {               title: " ",               dataIndex: "f/mm",               key: "f/mm",               width: 100,               fixed: "left"             }          ]
        },
    ],
  },
  {
    title: "Fim da Protecao de Molde",
    dataIndex: "fim-da-protecao-de-molde",
    key: "fim-da-protecao-de-molde",
    children: [
      {
        title: "Forca",
        dataIndex: "fim-da-protecao-de-molde-forca",
        key: "fim-da-protecao-de-molde-forca",
        width: 100,
      },
      {
        title: "Ponto",
        dataIndex: "fim-da-protecao-de-molde-ponto",
        key: "fim-da-protecao-de-molde-ponto",
        width: 100,
      },
    ],
  },
  {
    title: "Pressao de Protecao de Molde",
    dataIndex: "pressao-de-protecao-de-molde",
    key: "pressao-de-protecao-de-molde",
    children: [
      {
        title: "Forca",
        dataIndex: "pressao-de-protecao-de-molde-forca",
        key: "pressao-de-protecao-de-molde-forca",
        width: 100,
      },
      {
        title: "Ponto",
        dataIndex: "pressao-de-protecao-de-molde-ponto",
        key: "pressao-de-protecao-de-molde-ponto",
        width: 100,
      },
    ],
  },
];

const data = [  {    key: "1",    "fim-da-protecao-de-molde-forca": "300N",    "fim-da-protecao-de-molde-ponto": "50mm",    "pressao-de-protecao-de-molde-forca": "100N",    "pressao-de-protecao-de-molde-ponto": "20mm",    "unidades": "",    "f/mm": "F/mm"  },];

const App = () => (
  <Table columns={columns} dataSource={data} scroll={{ x: 1000 }} />
);

export default App;
